import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    container: {
        display: 'flex',
        minHeight: '100vh',
        height: '100%',
        flexDirection: 'column'
    },
    webHeader: {
        flex: '0 1 auto',
    },
    webBlock: {
        flex: '1 1 auto',
        margin: '50px 0',
        width: '100%',
        height: '80%'
    },
    webFooter: {
        flex: '1 0 auto',
    },
    webContainer: {
        backgroundColor: '#dfdfff',
        padding: '40px 20px',
        borderRadius: 10
    }
}))

export default useStyles
